import React, { Component } from 'react'
import logo from '../components/logo-logic.svg'
import logout from '../components/white-logout-logo.png'
import Styles from './employee.module.css'
import Cookies from 'universal-cookie';
class HeaderComponent extends Component {
    constructor(props) {
        super(props)

        this.state = {
                 
        }
    }

    handleLogout = () => {
        const cookies = new Cookies();
        cookies.remove("loginStatus");
        this.props.history.push('/');
    }

    render() {
        return (
            <header className={Styles.header}>
                <img className={Styles.logoImage} src={logo} alt="Logic Logo" />
                <a onClick={()=>{handleLogout}}><img className={Styles.logoutButton} src={logout} alt="Logout Logo" /></a>
          </header>
        )
    }
}

export default HeaderComponent
